import React from "react";
import InboxItem from "./InboxItem";

const Inbox = ({token, posts, setPosts}) => {

    console.log(posts);
    return (<>
        <div>
            {posts.map((post) => {
                console.log("KEYSEARCH", post)
                return <InboxItem 
                key={post._id}
                post={post} 
                setPosts={setPosts}
                token={token} 
                />
            })}
        </div>
    </>)
}

export default Inbox;
